import React, {Component} from 'react';
import Foodtit from "../productlistmsg/foodtit";
import {Link} from "react-router-dom";
import './my.scss';
class My extends Component {
    render() {
        return (
            <div className="my">
                {/*1、标题部分*/}
                <Foodtit tit="我的"/>
                {/*2、登录和注册*/}
                <div className="loginAndregistration">
                    <Link to="/loginAndregistration">

                        {/*2.1\logo    */}
                        <img src={require("../../../static/img/footer/logo2.png")} alt="饿了么logo"/>
                        {/*2.2登录和注册*/}
                        <div className="LAR">
                            <div className="lar">登录/注册</div>
                            <div className="more">
                                <span className="iconfont icon-shouji2"></span>
                                登录后享受更多特权
                            </div>

                        </div>
                        {/*2.3 又见头*/}
                        <span className="iconfont icon-arrow-left"></span>

                    </Link>


                </div>
                {/*3、主要内容区域*/}
                <div className="maininfo">
                    <div className="wallet">
                        <span className="iconfont icon-qian1"></span>
                        <span className="text">钱包</span>
                    </div>
                    <div className="red-packer">
                        <span className="iconfont icon-hongbao1"></span>
                        <span className="text">红包</span>
                    </div>
                    <div className="gold">
                        <span className="iconfont icon-jinbi1"></span>
                        <span className="text">金币</span>
                    </div>

                </div>
                {/*4、具体个人信息*/}
                <div className="mymsg">
                    {/*4.1我的地址*/}
                   <Link to="/" className="mydress  btb2 mymsgmore">
                       <div className="dreass">
                           <span className="iconfont icon-dizhi"></span>
                           <span className='text'>我的地址</span>
                           <span className="iconfont icon-arrow-left"></span>
                       </div>


                   </Link>
                    {/*4.2gold */}
                    <Link to="/" className="money  btb2 mymsgmore" >
                        <div className="goldshop    ">
                            <span className="iconfont icon-fenqishangcheng"></span>
                            <span className='text'>我的地址</span>
                            <span className="iconfont icon-arrow-left"></span>
                        </div>
                        <div className="share ">
                            <span className="iconfont icon-liwu1"></span>
                            <span className='text'>我的地址</span>
                            <span className="iconfont icon-arrow-left"></span>
                        </div>
                    </Link>
                    {/*4.3客服*/}
                    <Link to="/" className="server btb2 mymsgmore"></Link>
                </div>
            </div>
        );
    }
}

export default  My;
